import React from "react";
import { Link } from "react-router-dom";
import "./Contact.css";

const Contact = () => {
  return (
    <div className="contact-page-cont">
      <section>
        <h1>We'd Love to Hear From You</h1>
        <section>
          <h3> Contact us </h3>
          <li> <Link to="/"> 004917581005650 </Link> </li>
          <li> <Link to="/"> uelandrae@gamil.com </Link> </li>
        </section>

        <section>
          <h3> Come See Us </h3>
          <li> <Link to="/"> Pinneberg, Germany </Link> </li>
          <li> <Link to="/"> Hamburg, Germany </Link> </li>
        </section>

        <section>
          <h3>24/7 Support</h3>
          <li> <Link to="/"> Open a support case </Link> </li>
          <li> <Link to="/"> Call us now </Link> </li>
        </section>
      </section>
    </div>
  );
};

export default Contact;
